module Transition_Calculator(clk, load, clear, data, count);
    input clk, load;
    input clear;
    input [9:0] data;
    output reg [4:0] count;

    parameter WIDTH = 10; // Define the width of the data input

    always @(posedge clk or negedge clear) begin
        if (~clear) begin // Asynchronous reset
            count <= 0;
        end else if (load) begin // Synchronous load and calculation
            count <= calculate_transitions(data);
        end
    end

    function [4:0] calculate_transitions(input [9:0] data);
        integer i;
        reg [4:0] transitions;

        transitions = 0;
        for (i = 1; i < WIDTH; i = i + 1) begin
            if (data[i] != data[i-1]) begin
                transitions = transitions + 1;
            end
        end
        calculate_transitions = transitions;
    end
endmodule
