/// Reads a text file and counts the frequency of each word.
/// The results are sorted by frequency and then alphabetically.
/// 
/// # Examples
/// 
/// Given a file `words.txt` with the following content:
/// ```
/// apple
/// banana
/// apple
/// orange
/// banana
/// apple
/// ```
/// The program should output:
/// ```
/// apple: 3
/// banana: 2
/// orange: 1
/// ```
fn count_words<P: AsRef<Path>>(file_path: P) -> io::Result<Vec<(String, usize)>> {
    let file = File::open(file_path)?;
    let reader = io::BufReader::new(file);

    let mut counts = HashMap::new();

    reader.lines().try_for_each(|line| {
        *counts.entry(line?).or_insert(0) += 1;
        Ok(())
    })?;

    let mut counts_vec: Vec<_> = counts.into_iter().collect();
    counts_vec.sort_by(|a, b| b.1.cmp(&a.1).then_with(|| a.0.cmp(&b.0)));

    Ok(counts_vec)
}

